import React, { Component } from 'react';
import StudentDataService from '../services/tutorial.service';

export default class AddTutorial extends Component {
  constructor(props){  //ทำทันที
    super(props);  // ส่งให้คลาสแม่

    this.onChangestudentID = this.onChangestudentID.bind(this);
    this.onChangename = this.onChangename.bind(this);
    this.onChangelastname = this.onChangelastname.bind(this);
    this.onChangeunivercity = this.onChangeunivercity.bind(this);
    this.saveStudent = this.saveStudent.bind(this);
    this.newstudents= this.newstudents.bind(this);

    this.state = {
      id: null,
      studentsID: "",
      name: "",
      lastname: "",
      univercity: "",
      education: false,
      submitted: false
    }
  }
  onChangestudentID(e) {
    this.setState({
      studentID: e.target.value
    });
  }

  onChangename(e) {
    this.setState({
      name: e.target.value
    });
  }

  onChangelastname(e) {
    this.setState({
      lastname: e.target.value
    });
  }

  onChangeunivercity(e) {
    this.setState({
      univercity: e.target.value
    });
  }

  saveStudent() {
    var data = {
      name: this.state.name,
      lastname: this.state.lastname,
      univercity: this.state.univercity
    };

    StudentDataService.create(data)
      .then( response => {
        this.setState({
          id: response.data.id,
          studentsID: response.data.studentsID,
          name: response.data.name,
          lastname: response.data.lastname,
          univercity: response.data.univercity,
          education: response.data.education,

          submitted: true
        });
        console.log(response.data);
      })
      .catch(err => {
        console.log(err);
      });
  }

  newstudents(){
    this.setState({
      id: null,
      studentsID: "",
      name: "",
      lastname: "",
      univercity: "",
      education: false,
      submitted: false
    });
  }

  render() {
    return (
      <div className='submit-form'>
        {this.state.submitted ? (
          <>
            <h4>You submitted successfully</h4>
            <button className='btn btn-success' onClick={this.newstudents}>Add</button>
          </>
        ) : (
          <>
            <div className='form-group'>
              <label htmlFor='sutdent'>Title:</label>
              <input type='text' 
                className='form-control' 
                id='title' value={this.state.title}
                onChange={this.onChangeTitle}
                name='title'
                required />
            </div>
            <div className='form-group'>
              <label htmlFor='description'>รหัสนักศึกษา :</label>
              <input type='text' 
                className='form-control' 
                id='description' value={this.state.description}
                onChange={this.onChangeDescription}
                name='description'
                required />
            </div>
            <div className='form-group'>
              <label htmlFor='description'>ชื่อ :</label>
              <input type='text' 
                className='form-control' 
                id='description' value={this.state.description}
                onChange={this.onChangeDescription}
                name='description'
                required />
            </div>
            <div className='form-group'>
              <label htmlFor='description'>นามสกุล :</label>
              <input type='text' 
                className='form-control' 
                id='description' value={this.state.description}
                onChange={this.onChangeDescription}
                name='description'
                required />
            </div>
            <div className='form-group'>
              <label htmlFor='description'>มหาวิทยาลัย :</label>
              <input type='text' 
                className='form-control' 
                id='description' value={this.state.description}
                onChange={this.onChangeDescription}
                name='description'
                required />
            </div>


            <button onClick={this.saveTutorial} 
              className='btn btn-success'>
                Submit
            </button>
          </>
        )}
      </div>
    )
  }
}
